import React from 'react';
import './3DGraphics.css'
export default function Graphics3D() {
  return (
    <>
      <div class="WorkDiv">
        <h1 class="WorkTitle" style={{ opacity: 1, transform: "translateY(0px)" }}>Treatment Tracking</h1>
        <span class="WorkBreakdown" style={{ opacity: 1, transform: "translateY(0px)" }}>Project Lead • UI / UX / Development • 2020</span>
      </div>
      <div>
      </div>
    </>
  )
}
